import React from "react";
import "./MidSection.css";

export default function MIdSection() {
  return (
    <div className="wrapper">
      <div className="text">
        <span className="head">Front-End React Developer</span>
        <br />
        <span className="desc">
          Hi, I'm Somesh Verma. A passionate Front-end React Developer based in
          Himachal, India. üìç
        </span>
        <div className="gitimg">
          <img src="Assets/Skills/git.png" className="git" />
          <img src="Assets/Skills/instagram.png" className="git" />
        </div>
      </div>
      <div className="image">
        <img src="Assets/rrrrr.png" className="img" />
      </div>
    </div>
  );
}
